import vollimg from  '../image/img3.jpg';
import './VolleyBall.css';
function VolleyBall() {
    return (
        <div className="VolleyBall">
      <div>

        <img src={vollimg} alt="BigCo Inc. logo"/>
      </div>
      </div>

    );
}

export default VolleyBall;
